info.description:
Her er ett brunt design til Skybyen.

Vil du bruke kodene på selve profilen sånn at alle kan se den?
Da fjærner du bare dette helt øverst:

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("skybyen.no") {

Og dette tegnet helt nederst:
}

Så er det bare å kopiere å lime inn i CSS kode boksen i innstillinger.

style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("skybyen.no") {
body {

background-image: none !important;

background-attachment: fixed !important;

background-position: top center !important;

background-color: #8B4513 !important;

}



#page-body {

background-image: none !important;

}



.mod_gray_header {

-webkit-border-radius: 10px !important;

-moz-border-radius: 10px !important;

border-radius: 10px !important;

}



.mod_gray_header {

width: 213px !important;

margin-left: 7px !important;

background-image: none !important;

background-color: transparent !important;

-moz-box-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -6px 8px #CD853F, 2px -8px 11px #CD853F;

-icab-box-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -6px 8px #CD853F, 2px -8px 11px #CD853F;

-khtml-box-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -6px 8px #CD853F, 2px -8px 11px #CD853F;

-webkit-box-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -6px 8px #CD853F, 2px -8px 11px #CD853F;

border: none !important;

}



.user_info_module {

border: none !important;

}



.mod_gray_header h3, .mod_gray_body {

text-align: center !important;

color: #8B4513 !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -5px 6px #CD853F, 2px -6px 8px #CD853F !important;

}



.fatka_title, .profile_block a, .profile_report a {

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F !important;

}



.profile_block a, .profile_report a {

color: #8B4513 !important;

}



#cometchat_base {

background-image:none !important;

border: 1px solid transparent !important;

width: 1500px !important;

margin-left: 195px !important;

border-radius: 5px;

-webkit-border-radius: 5px;

-moz-border-radius: 5px !important;

}



.cometchat_tab {

background-image: none !important;

border: none !important;

}



#cometchat_optionsbutton {

visibility: visible !important;

}



.wrapper, .wrapper_top, .sky_footer {

-webkit-border-radius: 10px;

-moz-border-radius: 10px;

border-radius: 10px;

-moz-box-shadow: 2px 2px 4px 0px #000;

-icab-box-shadow: 2px 2px 4px 0px #000;

-khtml-box-shadow: 2px 2px 4px 0px #000;

-webkit-box-shadow: 2px 2px 4px 0px #000;

background-color: transparent !important;

background-image:url('http://img84.imageshack.us/img84/2616/skybyenmiddle.png') !important;

border: 1px solid #000 !important;

}



.wrapper_top {

height: 280px !important;

}



.wrapper {

margin-top: 3px !important;

}



#searchusersbox, #searchusersbox:focus {

color: #CD853F !important;

background-image: none !important;

-webkit-border-radius: 10px !important;

-moz-border-radius: 10px !important;

border-radius: 10px;

border: 1px solid #CD853F !important;

margin-right: 3.5px !important;

margin-top: -14.5px !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -5px 6px #CD853F, 2px -6px 8px #CD853F;

}



.spotlight_userinfo {

font-size: 10px !important;

color: #CD853F !important;

text-align: center !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F;

}



.spotlight_username_man {

text-align: center !important;

color: #CD853F !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F;

}



.spotlight_username_woman {

text-align: center !important;

color: #CD853F !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F;

}



.right_menu_div {

text-align: left !important;

background-image: none !important;

color: #CD853F !important;

margin-top: 2px !important;

margin-left: 3px !important;

width: 155px !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -5px 6px #CD853F, 2px -6px 8px #CD853F;

}



#menu ul {

margin-top: 16px !important;

border: 1px solid transparent !important;

}



#menu li {

background-image:url('http://img84.imageshack.us/img84/2616/skybyenmiddle.png') !important;

background-color: transparent !important;

border: none !important;

-webkit-border-radius: 5px;

-moz-border-radius: 5px;

border-radius: 5px;

-moz-box-shadow: 2px 2px 4px 0px #000;

-icab-box-shadow: 2px 2px 4px 0px #000;

-khtml-box-shadow: 2px 2px 4px 0px #000;

-webkit-box-shadow: 2px 2px 4px 0px #000;

margin-top: 16px !important;

margin-left: 4px !important;

color: purple !important;

}



#menu li {

border: 1px solid #000 !important;

}



#menu a.level1 span.bg, #menu span.level1 span.bg {

background-image: none !important;

background-color: transparent;

color: #CD853F !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -5px 6px #CD853F, 2px -6px 8px #CD853F;

}



.user_dashboard {

font-size: 8px !important;

background-image:url('http://img84.imageshack.us/img84/2616/skybyenmiddle.png') !important;

background-color: transparent !important;

border: 1px solid #000 !important;

-webkit-border-radius: 5px;

-moz-border-radius: 5px;

border-radius: 5px;

-moz-box-shadow: 2px 2px 3px 0px #000;

-icab-box-shadow: 2px 2px 3px 0px #000;

-khtml-box-shadow: 2px 2px 3px 0px #000;

-webkit-box-shadow: 2px 2px 3px 0px #000;

margin-top: 33px !important;

margin-right: 7px !important;

width: 240px !important;

}



.user_dashboard a, #sharetheloved a, #sharethekissed a, #sharetheflirted a {

color: #CD853F !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F !important;

}



#sharetheloved a:hover, #sharethekissed a:hover, #sharetheflirted a:hover {

color: #8B4513 !important;

}



#menu li:hover {

border: 1px solid transparent !important;

background-image:url('http://img84.imageshack.us/img84/2616/skybyenmiddle.png') !important;

background-color: transparent !important;

-moz-border-radius: 5px !important;

-webkit-border-radius: 5px !important;

border-radius: 5px !important;

-moz-box-shadow: 0px 0px 3px 2px #CD853F;

-icab-box-shadow: 0px 0px 3px 2px #CD853F;

-khtml-box-shadow: 0px 0px 3px 2px #CD853F;

-webkit-box-shadow: 0px 0px 3px 2px #CD853F;

color: #8B4513 !important;

}



.profile_actions, .profile_actions_left, .profile_actions_right, .cometchat_trayicon, #cometchat_userstab_text, #cometchat_hide {

background-image: none !important;

background-color: transparent !important;

border: none !important;

color: #CD853F !important;

text-shadow: none !important;

}



.profile_actions, .profile_actions_left, .profile_actions_right {

border: 1px solid transparent !important;

border-radius: 5px !important;

-moz-border-radius: 5px !important;

-webkit-border-radius: 5px !important;

-moz-box-shadow: 2px 2px 3px 0px #000;

-icab-box-shadow: 2px 2px 3px 0px #000;

-khtml-box-shadow: 2px 2px 3px 0px #000;

-webkit-box-shadow: 2px 2px 3px 0px #000;

padding-top: 0px !important;

padding-left: 0px !important;

height: 20px !important;

width: 102px !important;

text-align: center !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F !important;

}



.profile_actions_left:hover, .profile_actions:hover, .profile_actions_right:hover {

color: #8B4513 !important;

border: 1px solid transparent !important;

-moz-border-radius: 5px !important;

-webkit-border-radius: 5px !important;

border-radius: 5px !important;

-moz-box-shadow: 2px 2px 3px 0px #CD853F;

-icab-box-shadow: 2px 2px 3px 0px #CD853F;

-khtml-box-shadow: 2px 2px 3px 0px #CD853F;

-webkit-box-shadow: 2px 2px 3px 0px #CD853F;

padding-top: 0px !important;

height: 20px !important;

background-color: transparent !important;

}



.right_menu_div:hover {

margin-top: 2px !important;

margin-left: 3px !important;

width: 155px !important;

background-image: none !important;

background-color: transparent !important;

-moz-border-radius: 5px !important;

-webkit-border-radius: 5px !important;

-moz-box-shadow: 0px 0px 3px 2px #CD853F;

-icab-box-shadow: 0px 0px 3px 2px #CD853F;

-khtml-box-shadow: 0px 0px 3px 2px #CD853F;

-webkit-box-shadow: 0px 0px 3px 2px #CD853F;

border: none !important;

color: #8B4513 !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -5px 6px #CD853F, 2px -6px 8px #CD853F !important;

}



.user_dashboard a:hover {

color: #8B4513 !important;

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F !important;

}



.spotlight_username_woman:hover, .spotlight_username_man:hover {

color: #8B4513 !important;

}



.spotlight_img {

margin-top: 30px !important;

border: none !important;

}



.spotlight_img:hover {

border: none !important;

-moz-box-shadow: 0px 0px 3px 2px #CD853F;

-icab-box-shadow: 0px 0px 3px 2px #CD853F;

-khtml-box-shadow: 0px 0px 3px 2px #CD853F;

-webkit-box-shadow: 0px 0px 3px 2px #CD853F;

}



.welcometext, #profile-status, .my_location, p, div, a {

color: #CD853F !important;

}



strong {

font-size: 12px !important;

color: #CD853F !important;

}



.welcometext {

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 3px #333, -2px -3px 4px #CD853F, 2px -3px 3px #CD853F !important;

}



span[style="color: rgb(2, 167, 0); font-size: 12px; font-weight: bold;"], span[style="color: rgb(113, 113, 113); font-size: 12px; font-weight: bold;"] {

text-shadow: 3px 3px 5px #000,  0 0 4px #111, 0 -2px 2px #222, 2px -4px 4px #333, -2px -5px 6px #CD853F, 2px -6px 8px #CD853F !important;

color: #8B4513 !important;

}

}
